import Link from 'next/link';

const Nav = () => (
  <div id="navwrapper">
    <Link href="/">
      <a>J and M Transmission</a>
    </Link>
    <Link href="/">
      <a>Contact</a>
    </Link>
    <Link href="/">
      <a>About</a>
    </Link>
  </div>
);

export default Nav;
